-- 生成 1000 users

-- 生成 2000 products
SET @rownum := 0;
SELECT 
  CONCAT('Product ', @rownum := @rownum + 1) AS name,
  CONCAT('Description for product ', @rownum) AS description,
  ROUND(10 + (RAND() * 90), 2) AS price,          -- 價格介於 10 ~ 100
  FLOOR(RAND() * 100) AS stock,                     -- 庫存 0~99
  CONCAT('https://example.com/images/product_', @rownum, '.jpg') AS image_url,
  FLOOR(1 + (RAND() * 21)) AS category_id,           -- 假設 category_id 1~21 有效
  FLOOR(1 + (RAND() * 10)) AS seller_id,             -- 假設 seller_id 1~10 有效
  NOW() AS created_at
FROM 
  (SELECT 1 FROM (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t1,
                 (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t2,
                 (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t3,
                 (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t4,
                 (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t5) seqs
LIMIT 2000;

-- 生成 2000 orders

-- 生成 2000 order_items

SELECT
  FLOOR(1 + RAND() * (SELECT MAX(id) FROM orders)) AS order_id,
  FLOOR(1 + RAND() * (SELECT MAX(id) FROM products)) AS product_id,
  FLOOR(1 + RAND() * 5) AS quantity,
  ROUND(10 + RAND() * 90, 2) AS unit_price,
  FLOOR(1 + RAND() * 5) * ROUND(10 + RAND() * 90, 2) AS total_price,
  NOW() AS created_at
FROM
  (SELECT 1 FROM 
    (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t1,
    (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t2,
    (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t3,
    (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t4,
    (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3) t5
  LIMIT 2000) seqs;


-- 生成 5000 cart_items
SELECT
  FLOOR(1 + RAND() * (SELECT MAX(id) FROM users)) AS user_id,
  FLOOR(1 + RAND() * (SELECT MAX(id) FROM products)) AS product_id,
  FLOOR(1 + RAND() * 10) AS quantity,      -- 數量 1~10
  NOW() AS added_at,
  NULL AS updated_at
FROM
  (SELECT 1 FROM 
    (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4) t1,
    (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4) t2,
    (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4) t3,
    (SELECT 0 UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4) t4
  LIMIT 5000) seqs;
